function saveGame()
{
    $url = 'http://cdnapi.bbwansha.com/bb_video30/Home/game/games/version/3/app_id/6/app_sub_id/1?sign=d7e263455156a7db13987ed96f5acdc2&t=5A052440';

    global $db;
    $data = file_get_contents($url);
    $data = json_decode($data,true);
    foreach($data['data'] as $row){
        foreach($row['gamelist'] as $game){
            unset($game['game_id']);
            $db->insert('course_game_list',$game );
        }
        unset($row['gamelist']);
        $db->insert('course_game_category',$row);

    }
    echo 'ok!';
    exit;
}

